public class InnerWebACLStatementFactory(Action<Humidifier.WAFv2.WebACLTypes.Statement> factoryAction = null) : SubResourceFactory<Humidifier.WAFv2.WebACLTypes.Statement>
{

    internal InnerWebACLSizeConstraintStatementFactory SizeConstraintStatementFactory { get; set; }

    internal InnerWebACLAndStatementFactory AndStatementFactory { get; set; }

    internal InnerWebACLXssMatchStatementFactory XssMatchStatementFactory { get; set; }

    internal InnerWebACLNotStatementFactory NotStatementFactory { get; set; }

    internal InnerWebACLByteMatchStatementFactory ByteMatchStatementFactory { get; set; }

    internal InnerWebACLRateBasedStatementFactory RateBasedStatementFactory { get; set; }

    internal InnerWebACLGeoMatchStatementFactory GeoMatchStatementFactory { get; set; }

    internal InnerWebACLRuleGroupReferenceStatementFactory RuleGroupReferenceStatementFactory { get; set; }

    internal InnerWebACLLabelMatchStatementFactory LabelMatchStatementFactory { get; set; }

    internal InnerWebACLRegexMatchStatementFactory RegexMatchStatementFactory { get; set; }

    internal InnerWebACLSqliMatchStatementFactory SqliMatchStatementFactory { get; set; }

    internal InnerWebACLRegexPatternSetReferenceStatementFactory RegexPatternSetReferenceStatementFactory { get; set; }

    internal InnerWebACLOrStatementFactory OrStatementFactory { get; set; }

    internal InnerWebACLManagedRuleGroupStatementFactory ManagedRuleGroupStatementFactory { get; set; }

    internal InnerWebACLIPSetReferenceStatementFactory IPSetReferenceStatementFactory { get; set; }

    protected override Humidifier.WAFv2.WebACLTypes.Statement Create()
    {
        var statementResult = CreateStatement();
        factoryAction?.Invoke(statementResult);

        return statementResult;
    }

    private Humidifier.WAFv2.WebACLTypes.Statement CreateStatement()
    {
        var statementResult = new Humidifier.WAFv2.WebACLTypes.Statement();

        return statementResult;
    }
    public override void CreateChildren(Humidifier.WAFv2.WebACLTypes.Statement result)
    {
        base.CreateChildren(result);

        result.SizeConstraintStatement ??= SizeConstraintStatementFactory?.Build();
        result.AndStatement ??= AndStatementFactory?.Build();
        result.XssMatchStatement ??= XssMatchStatementFactory?.Build();
        result.NotStatement ??= NotStatementFactory?.Build();
        result.ByteMatchStatement ??= ByteMatchStatementFactory?.Build();
        result.RateBasedStatement ??= RateBasedStatementFactory?.Build();
        result.GeoMatchStatement ??= GeoMatchStatementFactory?.Build();
        result.RuleGroupReferenceStatement ??= RuleGroupReferenceStatementFactory?.Build();
        result.LabelMatchStatement ??= LabelMatchStatementFactory?.Build();
        result.RegexMatchStatement ??= RegexMatchStatementFactory?.Build();
        result.SqliMatchStatement ??= SqliMatchStatementFactory?.Build();
        result.RegexPatternSetReferenceStatement ??= RegexPatternSetReferenceStatementFactory?.Build();
        result.OrStatement ??= OrStatementFactory?.Build();
        result.ManagedRuleGroupStatement ??= ManagedRuleGroupStatementFactory?.Build();
        result.IPSetReferenceStatement ??= IPSetReferenceStatementFactory?.Build();
    }

} // End Of Class

